// import {Navbar, Container, Nav} from 'react-bootstrap';
import {BrowserRouter as Router, Routes, Route, Link} from "react-router-dom";
import Home from "../Home/Home";

class NavTop extends Component {
    render() {
        const About = () => {
            return (
              <p>About</p>
            )
        }

        return (
          <>
