                      {/*        </Nav>*/}
                      {/*    </Container>*/}
                      {/*</Navbar>*/}

                      <Routes>
                          <Route path='/' element={<Home/>} />
                      </Routes>
                      <Routes>
                          <Route path='/about' element={<About/>} />
                      </Routes>
                  </div>
              </Router>
          </>
        )
    }
}

export default NavTop;
